import React, { useState } from 'react';
import './Header.scss';

function Header() {
  return (
    <header>
      <h1>My Cyworld Portfolio</h1>
      <nav>
        <ul>
          <li>홈</li>
          <li>프로필</li>
          <li>프로젝트</li>
          <li>?</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
